@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document url-prefix("https://www.freedesktop.org/software/systemd/man/") {

@font-face {
  font-family: 'PT Mono';
  font-style: normal;
  font-weight: 400;
  src: local('PT Mono'), local('PTMono-Regular'), url(data:font/woff2;base64,) format('woff2');
  unicode-range: U+0000-00FF, U+0131, U+0152-0153, U+02BB-02BC, U+02C6, U+02DA, U+02DC, U+2000-206F, U+2074, U+20AC, U+2122, U+2191, U+2193, U+2212, U+2215, U+FEFF, U+FFFD;
}
@font-face {
  font-family: 'PT Serif';
  font-style: normal;
  font-weight: 400;
  src: local('PT Serif'), local('PTSerif-Regular'), url(data:font/woff2;base64,) format('woff2');
  unicode-range: U+0000-00FF, U+0131, U+0152-0153, U+02BB-02BC, U+02C6, U+02DA, U+02DC, U+2000-206F, U+2074, U+20AC, U+2122, U+2191, U+2193, U+2212, U+2215, U+FEFF, U+FFFD;
}

body {
  font-size: 22px;
  font-family: 'PT Serif', serif;
  line-height: 1.5;
  max-width: 760px;
  margin: 1em;
}
tt, code, kbd, samp {
  font-family: 'PT Mono', monospace;
  background-color: #f6f6ee;
  padding: 5px;
}
a.headerlink {
  font-size: 1em;
  padding: 0 0.4em;
}
a.headerlink {
  font-size: 1em;
  padding: 0 0.4em;
}
a:not(.headerlink) {
  text-decoration: none;
  border-bottom: 2px solid blue;
  box-shadow: inset 0 0 0 0 blue;
  transition: box-shadow .15s ease-in-out, border-color .15s ease-in-out, color .15s ease-in-out;
}
a:not(.headerlink):hover, a:not(.headerlink):focus {
  box-shadow: inset 0 -1.5em 0 0 blue;
  color: white;
}
a:not(.headerlink):active {
  box-shadow: inset 0 -1.5em 0 0 #c60f0f;
  border-bottom: 2px solid #c60f0f;
  color: white;
}
a:not(.headerlink):visited {
  box-shadow: inset 0 0 0 0 #840084;
  border-bottom-color: #840084;
}
a:not(.headerlink):visited:hover, a:not(.headerlink):visited:focus {
  border-bottom-color: blue;
}
}
